import sapLogo from "../styles/SAP_2011_logo.png";
import bannerImage from "../styles/DSCF1113.jpeg";
import eliseAtComputer from "../styles/EliseAtComputerSAP.jpg";
import eliseAtWhiteboard from "../styles/EliseAtWhiteboardSAP.jpg";
import eliseWithSAPLogoTeeth from "../styles/EliseWithSAPLogoTeeth.jpg";
import { useState } from "react";

function ImageCarousel({ images }) {
  const [current, setCurrent] = useState(0);

  const nextImage = () => setCurrent((current + 1) % images.length);
  const prevImage = () =>
    setCurrent((current - 1 + images.length) % images.length);

  return (
    <div className="carousel-container">
      <button className="carousel-arrow left" onClick={prevImage} aria-label="Previous Image">
        &#8592;
      </button>
      <div className="carousel-image-wrapper">
        <img
          src={images[current].src}
          alt={images[current].alt}
          className="carousel-image"
        />
        <div className="carousel-caption">{images[current].caption}</div>
      </div>
      <button className="carousel-arrow right" onClick={nextImage} aria-label="Next Image">
        &#8594;
      </button>
    </div>
  );
}

function Home() {
  const carouselImages = [
    {
      src: eliseAtComputer,
      alt: "Elise working at computer at SAP",
      caption: "Problem-solving at my desk"
    },
    {
      src: eliseAtWhiteboard,
      alt: "Elise at SAP whiteboard",
      caption: "Collaborating at the whiteboard"
    },
    // Add more images here as desired
  ];

  return (
    <div className="Home">
      {/* Full width hero image */}
      <div className="hero-image">
        <img src={bannerImage} alt="Banner Image" />
      </div>

      {/* Remove the hero-section title and navigation if the Header is used */}
      <div id="welcome" className="content-section">
        <h2>Welcome</h2>
        <p>
          Welcome to my co-op portfolio! This website showcases my experiences, skills, and reflections from my co-op work terms.
          Here, you'll find detailed information about my roles, the projects I worked on, and the skills I developed along the way.
          Feel free to explore and learn more about my journey!
        </p>
      </div>

      {/* Work Term 1 Section */}
      <div id="work-term-1" className="content-section">
        <div className="work-term-container">
          <div className="work-term-text">
            <h2>Work Term 1: SAP CI/CD Pipeline Developer</h2>
            <p>
              This section outlines my experiences, goals, and reflections from my first work term.
            </p>
            <h3>Key Highlights</h3>
            <ul>
              <li>Experience 1: Description of the first key experience.</li>
              <li>Experience 2: Description of the second key experience.</li>
              <li>Experience 3: Description of the third key experience.</li>
            </ul>
            <h3>Skills Developed</h3>
            <p>
              During my co-op term, I developed several skills including teamwork, problem-solving, and technical skills relevant to my field.
            </p>
          </div>
          <div className="work-term-images">
            <div className="sap-logo-group">
              <img src={sapLogo} alt="SAP Logo" className="sap-logo" />
              <img
                src={eliseWithSAPLogoTeeth}
                alt="Elise with SAP logo teeth"
                className="side-photo"
              />
            </div>
            <ImageCarousel images={carouselImages} />
          </div>
        </div>
      </div>

      {/* Contact Section */}
      <div id="contact" className="contact-section">
        <h2>Contact</h2>
        <p>If you'd like to get in touch, feel free to reach out via email or LinkedIn.</p>
        <ul>
          <li>Email: <a href="mailto:elise.pitre@example.com">elise.pitre@example.com</a></li>
          <li>LinkedIn: <a href="https://www.linkedin.com/in/elise-pitre" target="_blank" rel="noopener noreferrer">linkedin.com/in/elise-pitre</a></li>
        </ul>
      </div>
    </div>
  );
}

export default Home;
